import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Landing.module.css';

function Navbar({ active }) {
  return (
    <nav className={styles.navbar}>
      <div className={styles.logo__wrapper}>
        <h4 className={styles.primaryText}>TaskTracker</h4>
      </div>
      <ul className={styles.navigationMenu}>
        <li>
          <Link to="/" className={active === 'home' ? 'activeNav' : ''}>Home</Link>
        </li>
        <li>
          <Link to="/login" className={active === 'login' ? 'activeNav' : ''}>Login</Link>
        </li>
        <li>
          <Link to="/register" className={active === 'register' ? 'activeNav' : ''}>Register</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
